import React from "react";

const Navbar = ({ setMain }) => {
  return (
    <div style={{ height: "60px" }} className="row no-gutters mb-2">
      <div className="col-auto p-1 mr-2">
        <div
          className="h-100 convex-1"
          style={{
            borderRadius: "50px",
            display: "flex",
            alignItems: "center",
            justifyContent: "center",
            width: "130px",
          }}
          onClick={() => {
            setMain("server");
          }}
        >
          Server
        </div>
      </div>
      <div className="col-auto p-1 mr-2">
        <div
          className="h-100 convex-1"
          style={{
            borderRadius: "50px",
            display: "flex",
            alignItems: "center",
            justifyContent: "center",
            width: "130px",
          }}
          onClick={() => {
            setMain("users");
          }}
        >
          Users
        </div>
      </div>
      <div className="col-auto p-1">
        <div
          className="h-100 convex-1"
          style={{
            borderRadius: "50px",
            display: "flex",
            alignItems: "center",
            justifyContent: "center",
            width: "130px",
          }}
          onClick={() => {
            setMain("stats");
          }}
        >
          Stats
        </div>
      </div>
      <div className="col p-1">
        <div className="row no-gutters"></div>
        <div
          className="h-100 convex-1"
          style={{
            borderRadius: "50px",
            display: "flex",
            alignItems: "center",
            justifyContent: "center",
            width: "130px",
          }}
          onClick={() => {
            setMain("stats");
          }}
        >
          Dashboard
        </div>
      </div>
    </div>
  );
};

export default Navbar;
